import React, { useContext, useRef, useEffect, useState } from "react";
import TestContext from "../../../Context/testContext";
import Swal from "sweetalert2/dist/sweetalert2.js";
import "sweetalert2/src/sweetalert2.scss";
import '../../../Scss/Flowchart.css'

function useEffectSkipFirst(fn, arr) {
  const isFirst = useRef(true);
  useEffect(() => {
    if (isFirst.current) {
      isFirst.current = false;
      return;
    }
    fn();
  }, arr);
}

const ResultFlowchart = () => {
  useEffect(() => {
    GetActiveTournaments(0);
  }, []);
  const testContext = useContext(TestContext);
  const {
    GetActiveTournaments,
    activeTournamentData,
    deletedTournamentData,
    GetPreviousTournaments,
    DeleteTournament,
    err,
  } = testContext;

  useEffectSkipFirst(() => {
    if (deletedTournamentData) {
      GetActiveTournaments();
    }
  }, [deletedTournamentData]);

  const delteItem = (itemId) => {
    Swal.fire({
      title: "Are you sure?",
      text: "You won't be able to revert this!",
      icon: "warning",
      showCancelButton: true,
      confirmButtonColor: "#3085d6",
      cancelButtonColor: "#d33",
    }).then((result) => {
      if (result.isConfirmed) {
        DeleteTournament(itemId);
      }
    });
  };

  useEffectSkipFirst(() => {
    if (deletedTournamentData) {
      Swal.fire({
        text: " Your file has been deleted.",
        icon: "success",
      }).then((result) => {});
      GetActiveTournaments();
    }
  }, [deletedTournamentData]);

  const NameGameById = (id) => {
    switch (id) {
      case 1:
        return "WARZON";
        break;
      case 2:
        return "DOTA2";
        break;

      default:
        break;
    }
  };

  return (
    <div className="ActiveTpurnament">
      <div className="HeadCreate">
        <h4>Active Tournament</h4>
      </div>
      {activeTournamentData
        ? activeTournamentData.map((item) => (
            <div key={item.id} className="ActiveAdd">
              <h5>{item.Title}</h5>
              <div className="boxAdd">
                <h6>{NameGameById(item.GameId)}</h6>
                <h6 className="larghx">
                  {item.StartDate} - {item.EndDate}
                </h6>
                <h6 className="largh">{item.KDLimit}</h6>

                <h6>{item.Prize}$</h6>
                <h6>{item.EntryFee}FLC</h6>
                <div className="buttonsDiv">
                  <button className="eDitActive">Edit</button>
                </div>
              </div>
            </div>
          ))
        : null}

      <div class="container2">

        <ol class="level-2-wrapper">
          <li>
            <h2 class="level-2 rectangle">Director A</h2>
            <ol class="level-3-wrapper">
              <li>
                <h3 class="level-3 rectangle">Manager A</h3>
                <ol class="level-4-wrapper">
                  <li>
                    <h4 class="level-4 rectangle">Person A</h4>
                  </li>
                  <li>
                    <h4 class="level-4 rectangle">Person B</h4>
                  </li>
                  <li>
                    <h4 class="level-4 rectangle">Person C</h4>
                  </li>
                  <li>
                    <h4 class="level-4 rectangle">Person D</h4>
                  </li>
                </ol>
              </li>
              <li>
                <h3 class="level-3 rectangle">Manager B</h3>
                <ol class="level-4-wrapper">
                  <li>
                    <h4 class="level-4 rectangle">Person A</h4>
                  </li>
                  <li>
                    <h4 class="level-4 rectangle">Person B</h4>
                  </li>
                  <li>
                    <h4 class="level-4 rectangle">Person C</h4>
                  </li>
                  <li>
                    <h4 class="level-4 rectangle">Person D</h4>
                  </li>
                </ol>
              </li>
            </ol>
          </li>
          <li>
            <h2 class="level-2 rectangle">Director B</h2>
            <ol class="level-3-wrapper">
              <li>
                <h3 class="level-3 rectangle">Manager C</h3>
                <ol class="level-4-wrapper">
                  <li>
                    <h4 class="level-4 rectangle">Person A</h4>
                  </li>
                  <li>
                    <h4 class="level-4 rectangle">Person B</h4>
                  </li>
                  <li>
                    <h4 class="level-4 rectangle">Person C</h4>
                  </li>
                  <li>
                    <h4 class="level-4 rectangle">Person D</h4>
                  </li>
                </ol>
              </li>
              <li>
                <h3 class="level-3 rectangle">Manager D</h3>
                <ol class="level-4-wrapper">
                  <li>
                    <h4 class="level-4 rectangle">Person A</h4>
                  </li>
                  <li>
                    <h4 class="level-4 rectangle">Person B</h4>
                  </li>
                  <li>
                    <h4 class="level-4 rectangle">Person C</h4>
                  </li>
                  <li>
                    <h4 class="level-4 rectangle">Person D</h4>
                  </li>
                </ol>
              </li>
            </ol>
          </li>
        </ol>
        <h1 class="level-1 rectangle">CEO</h1>
      </div>
    </div>
  );
};

export default ResultFlowchart;
